function Menu({ Items, onSelect })
{
    return (
        <ul>
            {
                Items.map(
                    (Item, index) => {
                    console.log(Item);
                        <li key={index} onClick={() => onSelect(Item)}>
                            {Item.ItemNum}
                        </li>
                    }
                )
            }
        </ul>
    );
}

export default Menu;
